import React from 'react'

export default function PatientsCount() {

        const stats = [
            { title: "Patients Served", value: "25,356" },
            { title: "Consultations this week", value: "6,050" },
            { title: "Locations", value: "21" },
            { title: "Success Rate", value: "95%" },
          ];
        
          return (
            <div className="relative w-[1543px] top-[205px] left-[-20px]  mx-auto bg-[#f8f8f8] py-12 px-4 flex flex-col items-center">
              {/* Main heading */}
              <h2 className="w-[701px] h-[102px] text-center text-[#444444] text-[50px] font-normal font-['Gilroy-Medium'] leading-[60px]">
                Our Stats show that we've Happy Patients
              </h2>
              {/* Subheading */}
              <p className="w-[618px] h-[47px] mt-[80px] text-center text-[#878787] text-lg 
                            font-normal font-['Helvetica'] leading-[21px]">
                And excellence partiality estimating terminated day everything.
              </p>
              
              <div className="flex flex-wrap justify-center gap-8">
                {stats.map((stat, index) => (
                  <div
                    key={index}
                    className="w-[264px] h-[207px] flex flex-col items-center justify-center bg-[#f8f8f8]"
                  >
                    <div className="absolute text-center text-[#444444] 
                                    text-[50px] font-normal font-['Gilroy-Medium'] mb-2">
                        {stat.value}
                    </div>

                    <div className="absolute text-center text-[#878787] 
                                    text-lg mt-[99px] font-normal font-['Helvetica']">
                        {stat.title}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          );
        };
